import React, { Component } from 'react'
import SearchBar from '../SearchBar'

export default class InstructorList extends Component {
    state = {
        data:[]
    }
    componentDidMount(){
        fetch(url + 'class')
        .then(res=>(
            res.json()
        ))
        .then(json=>{
            this.setState({
                data:json,
            });
        })
        .catch(err=>{
            console.log(err);
        })
    }
    render() {
        return (
            <div>
                <SearchBar placeholder='Search Instructor'/>
                <h1>Instructors</h1>
                {this.state.data.map((val, index)=>(
                    <li key={index}>{val}</li>
                ))}
            </div>
        )
    }
}
